/// <summary>
/// Updating the bank code lookpups from the W0X fields.
/// </summary>
protected void updateBankCodelookupValues()
{
    switch(gSKS_EFT_FileFormat.FormatId)
    {
        case ('US-CITI-CDFF-150-NL'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('PreformatCode', gSKS_EFT_Bank.W01);
            }
            break;
        case ('US-CITI-CDFF-150-UK'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('PreformatCode', gSKS_EFT_Bank.W01);
            }
            if(gSKS_EFT_Bank.W04)
            {
                this.updateBankFields('BACSUserNumber', gSKS_EFT_Bank.W04);
            }
            break;
    }
}

